-- DROP ROLE gpuser;

CREATE ROLE gpuser WITH 
	SUPERUSER
	CREATEDB
	CREATEROLE
	INHERIT
	LOGIN
	REPLICATION
	BYPASSRLS
	CONNECTION LIMIT -1;

alter user gpuser with password 'gpuser';

